                  <ul class="movie-meta">
                    <li><strong>Rating: {x/count} out of 10 </strong>


                    </li>
                    <li><strong>Release:</strong> {location.state.year}</li>
                    <li><strong>Langauge:</strong> {location.state.language}</li>
                    <li><strong>Category:</strong> {location.state.genre}</li>
                  </ul>

